def main():
    a, b, c, d = map(int, input().split())
    ans = b - a + 1
    ans -= (b // c - (a - 1) // c)
    ans -= (b // d - (a - 1) // d)
    ans += (b // (c*d) - (a - 1) // (c*d))  # 最小公倍数
    print(ans)


